import React from "react";

export const Chips = ({ chips, setChips }) => {
  console.log(chips);
  const handleDeleteChips = (thisChip) => {
    console.log(thisChip);
    setChips(chips?.filter((c) => c.id != thisChip));
  };
  return (
    <div className={`${chips?.length ? "mb-3" : null}`}>
      {chips?.map((c) => (
        <span className="chips">
          <i
            className="close fas fa-times ps-2 pointer"
            onClick={() => handleDeleteChips(c.id)}
          ></i>
          {c.value || c.title}
        </span>
      ))}
    </div>
  );
};
